import React from "react";

function Card(props) {
  return (
    <div className="card col-md-6 col-lg-4 border-white bg-dark text-white">
      <img src={props.image} className="card-img-top" alt="" />
      <div
        className="card-body"
        // style={{ backgroundColor: props.email ? "green" : "red" }}
      >
        <h5 className="card-title text-center fs-2">{props.name}</h5>
        <p className="card-text text-center fs-5">{props.position}</p>
        {/* <div className="info fs-6 mt-4">
          <p>Phone: {props.phone}</p>
          <p>Email: {props.email}</p>
          <p>Website: {props.website}</p>
        </div> */}
      </div>
    </div>
  );
}

export default Card;
